SELECT COUNT(*) AS web_sales_count, SUM(ws_ext_ship_cost) AS total_shipping_cost, SUM(ws_net_profit) AS total_net_profit FROM web_sales ws JOIN customer_address ca ON ws.ws_bill_addr_sk = ca.ca_address_sk JOIN web_site w ON ws.ws_web_site_sk = w.web_site_sk JOIN date_dim d ON ws.ws_sold_date_sk = d.d_date_sk WHERE ca.ca_state = 'given_state' AND w.web_name = 'named_web_site' AND d.d_date BETWEEN DATE '2023-01-01' AND DATE '2023-03-01' AND ws.ws_order_number NOT IN (SELECT wr_order_number FROM web_returns) AND ws.ws_order_number IN ( SELECT ws_order_number FROM web_sales GROUP BY ws_order_number HAVING COUNT(DISTINCT ws_warehouse_sk) > 1 );
